class MockObject:


    class MockAttrObj:
        OwO = 'nyaa'
assert functional.get_attr_path(MockObject, ('MockAttrObj', 'OwO')) == 'nyaa'
try:
    error = functional.get_attr_path(MockObject, "This key doesn't exist")
except Exception as e:
    error = e
assert isinstance(error, AttributeError)
